import React, { Component } from "react";


class Rank extends Component {
  state = {
    platform: "psn",
    profile: "Lil_Kha1998",
    platformInfo:"",
    rankData: {},
  };
  
  componentDidMount(){
    fetch(
      `http://localhost:5000/api/v1/rank/${this.state.platform}/${this.state.profile}}`
    )
      .then((res) => res.json())
      .then((res) =>
        this.setState({
          rankData: res.data.data.platformInfo[0],
        })
      )
      .catch((err) => console.log(err));
  };

  render() {
    const {platform,profile, rankData} = this.state;
    console.log(rankData)
    return (
      <div className="rank-wrapper">
        <div className="rank-content">
    
        
          <h1>Rank</h1>
          <div className="ranked-output">
       {rankData.platformUserInfo}
          </div>
        </div>
     </div>
    );
  }
}

export default Rank;
